    <style>
        :root {
            --primary-color: #00d4ff;
            --secondary-color: #0099cc;
            --accent-color: #ff6b35;
            --bg-primary: #0a0a0f;
            --bg-secondary: #1a1a2e;
            --text-primary: #ffffff;
            --text-secondary: #b0b0b0;
            --border-color: #333366;
            --hover-glow: rgba(0, 212, 255, 0.3);
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: linear-gradient(135deg, var(--bg-primary) 0%, var(--bg-secondary) 100%);
            color: var(--text-primary);
            min-height: 100vh;
            overflow-x: hidden;
        }

        /* Animated background */
        body::before {
            content: '';
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: 
                radial-gradient(circle at 20% 50%, rgba(0, 212, 255, 0.1) 0%, transparent 50%),
                radial-gradient(circle at 80% 20%, rgba(255, 107, 53, 0.1) 0%, transparent 50%),
                radial-gradient(circle at 40% 80%, rgba(0, 153, 204, 0.1) 0%, transparent 50%);
            animation: float 6s ease-in-out infinite;
            z-index: -1;
        }

        @keyframes float {
            0%, 100% { transform: translateY(0px); }
            50% { transform: translateY(-20px); }
        }

        .container {
            max-width: 400px;
            margin: 0 auto;
            padding: 2rem 1rem;
            position: relative;
            z-index: 1;
        }

        /* Customization Panel */
        .customization-panel {
            position: fixed;
            top: 20px;
            right: 20px;
            background: rgba(26, 26, 46, 0.9);
            border: 1px solid var(--border-color);
            border-radius: 15px;
            padding: 15px;
            backdrop-filter: blur(10px);
            z-index: 1000;
            transition: all 0.3s ease;
        }

        .customization-panel h3 {
            font-size: 0.9rem;
            margin-bottom: 10px;
            color: var(--primary-color);
        }

        .color-options {
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            gap: 8px;
            margin-bottom: 10px;
        }

        .color-btn {
            width: 30px;
            height: 30px;
            border: 2px solid transparent;
            border-radius: 50%;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        .color-btn:hover {
            transform: scale(1.1);
            border-color: var(--text-primary);
        }

        .color-btn.active {
            border-color: var(--primary-color);
            box-shadow: 0 0 10px var(--hover-glow);
        }

        /* Profile Section */
        .profile {
            text-align: center;
            margin-bottom: 2rem;
        }

        .profile-image {
            width: 120px;
            height: 120px;
            border-radius: 50%;
            margin: 0 auto 1rem;
            border: 3px solid var(--primary-color);
            box-shadow: 0 0 20px var(--hover-glow);
            overflow: hidden;
            position: relative;
        }

        .profile-image img {
            width: 100%;
            height: 100%;
            object-fit: cover;
        }

        .profile-title {
            font-size: 1.8rem;
            font-weight: 700;
            margin-bottom: 0.5rem;
            background: linear-gradient(45deg, var(--primary-color), var(--accent-color));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }

        .profile-subtitle {
            color: var(--text-secondary);
            font-size: 1rem;
        }

        /* Links Section */
        .links {
            display: flex;
            flex-direction: column;
            gap: 1rem;
        }

        .link-item {
            display: flex;
            align-items: center;
            padding: 1rem 1.5rem;
            background: rgba(26, 26, 46, 0.6);
            border: 1px solid var(--border-color);
            border-radius: 15px;
            text-decoration: none;
            color: var(--text-primary);
            transition: all 0.3s ease;
            backdrop-filter: blur(10px);
            position: relative;
            overflow: hidden;
        }

        .link-item::before {
            content: '';
            position: absolute;
            top: 0;
            left: -100%;
            width: 100%;
            height: 100%;
            background: linear-gradient(90deg, transparent, rgba(255, 255, 255, 0.1), transparent);
            transition: left 0.5s ease;
        }

        .link-item:hover::before {
            left: 100%;
        }

        .link-item:hover {
            transform: translateY(-5px);
            border-color: var(--primary-color);
            box-shadow: 0 10px 30px var(--hover-glow);
        }

        .link-item.featured {
            background: linear-gradient(135deg, var(--primary-color), var(--secondary-color));
            border-color: var(--primary-color);
            box-shadow: 0 5px 20px var(--hover-glow);
        }

        .link-item.featured:hover {
            box-shadow: 0 15px 40px var(--hover-glow);
            transform: translateY(-8px);
        }

        .link-icon {
            width: 24px;
            height: 24px;
            margin-right: 1rem;
            flex-shrink: 0;
        }

        .link-content {
            flex: 1;
        }

        .link-title {
            font-weight: 600;
            font-size: 1.1rem;
            margin-bottom: 0.2rem;
        }

        .link-description {
            font-size: 0.9rem;
            color: var(--text-secondary);
        }

        .link-item.featured .link-description {
            color: rgba(255, 255, 255, 0.8);
        }

        /* Responsive Design */
        @media (max-width: 768px) {
            .container {
                padding: 1rem 0.5rem;
            }
            
            .customization-panel {
                position: relative;
                top: auto;
                right: auto;
                margin-bottom: 1rem;
            }
            
            .profile-image {
                width: 100px;
                height: 100px;
            }
            
            .profile-title {
                font-size: 1.5rem;
            }
            
            .link-item {
                padding: 0.8rem 1rem;
            }
        }

        @media (max-width: 480px) {
            .link-item {
                padding: 0.7rem 0.8rem;
            }
            
            .link-title {
                font-size: 1rem;
            }
            
            .link-description {
                font-size: 0.8rem;
            }
        }
    </style>
</head>

        // Apply theme function (RF02)
        function applyTheme(themeName) {
            const theme = themes[themeName];
            const root = document.documentElement;
            
            Object.entries(theme).forEach(([key, value]) => {
                const cssVar = key.replace(/([A-Z])/g, '-$1').toLowerCase();
                root.style.setProperty(`--${cssVar}`, value);
            });
            
            // Update active color button
            document.querySelectorAll('.color-btn').forEach(btn => {
                btn.classList.remove('active');
                if (btn.dataset.theme === themeName) {
                    btn.classList.add('active');
                }
            });
        }

        // Render links function (RF01)
        function renderLinks() {
            const container = document.getElementById('linksContainer');
            
            linksData.forEach(link => {
                const linkElement = document.createElement('a');
                linkElement.href = link.url;
                linkElement.target = '_blank'; // RF04
                linkElement.rel = 'noopener noreferrer';
                linkElement.className = `link-item${link.featured ? ' featured' : ''}`;
                linkElement.setAttribute('aria-label', `${link.title} - ${link.description}`);
                
                linkElement.innerHTML = `
                    <div class="link-icon">${link.icon}</div>
                    <div class="link-content">
                        <div class="link-title">${link.title}</div>
                        <div class="link-description">${link.description}</div>
                    </div>
                `;
                
                container.appendChild(linkElement);
            });
        }

        // Initialize application (RNF02 - Compatibilidade)
        function init() {
            renderLinks();
            
            // Set up theme switching
            document.querySelectorAll('.color-btn').forEach(btn => {
                btn.addEventListener('click', () => {
                    applyTheme(btn.dataset.theme);
                });
            });
            
            // Try to load user's profile image (would be replaced with actual image)
            const profileImg = document.getElementById('profileImg');
            // In a real scenario, you'd replace this with the actual image URL
